  const factory LSError({required String message, required String code}) =
      _$LSError;

  String get message => throw _privateConstructorUsedError;
  String get code => throw _privateConstructorUsedError;
  @JsonKey(ignore: true)
  $LSErrorCopyWith<LSError> get copyWith => throw _privateConstructorUsedError;
}
